function(){


        function updatePaperfoldColor() {
  if(js_is_mobile_postpage) {
    var topbarwrap = document.getElementsByClassName('uw-top-bar')[0];
    topbarwrap.classList.add('is_mobile_postpage');
  }
}
updatePaperfoldColor();

function menuClick() {

document.getElementsByClassName('navbar-wrapper')[0].style.display = 'block';
addMenuCloseClickListener();
  document.getElementsByClassName('menu-wrapper')[0].style.display = 'none';
  var topbarwrap = document.getElementsByClassName('uw-top-bar')[0];
  topbarwrap.firstElementChild.style.display ='none';
  topbarwrap.children[1].style.display ='none';
  topbarwrap.classList.add('hide-fold');


}

function menuCloseClick() {
document.getElementsByClassName('navbar-wrapper')[0].style.display = 'none';
  document.getElementsByClassName('menu-wrapper')[0].style.display = 'block';
  var topbarwrap = document.getElementsByClassName('uw-top-bar')[0];
  topbarwrap.firstElementChild.style.display ='inline-block';
  topbarwrap.children[1].style.display ='inline-block';
  topbarwrap.classList.remove('hide-fold');
}

function addMenuClickListener() {
  var menuArrow = document.getElementsByClassName('menu-wrapper');
  var exploreText = menuArrow[0].getElementsByClassName('rebelbar__menu-toggle');
  menuArrow[0].addEventListener('click', menuClick);
  exploreText[0].addEventListener('click', menuClick);
}
addMenuClickListener();

function addMenuCloseClickListener() {
  var menuCloseIcon = document.getElementsByClassName('menu-close-icon');
  if(menuCloseIcon[0] != undefined) {
  	menuCloseIcon[0].addEventListener('click', menuCloseClick);
  }
}  
addMenuCloseClickListener();


} @ [object Object]
